import React, { useEffect } from 'react';
import { useContext } from 'react';
import UserContext from '../context/User/UserContext';

const UserList = () => {
	useContext(UserContext);

	useEffect(() => {}, []);

	return (
		<>
			<div>UserList</div>
		</>
	);
};

export default UserList;
